import React from 'react'
import { Badge } from 'react-bootstrap'


export const bug = () => {
    <Badge variant="info">#Bug</Badge>
}

export const web = () => {
    <Badge variant="danger">#web</Badge>
}

export const backEnd = () => {
    <Badge variant="info">#Back-end</Badge>
}
